import { Svg, Line, Circle } from "react-native-svg";
import TrebleClef from "../images/TrebleClef.svg";
import { View, StyleSheet, Image } from "react-native";

const Playground = () => {
  return (
    <View>
      <Lines />
      <TrebleClef></TrebleClef>
    </View>
  );
};

const style = StyleSheet.create({
  playground: {
    flex: 1,
    padding: 200,
    height: 200
  }
});

export { Playground };
